import React from 'react';
import './Navbar.css';
import { Link } from 'react-router-dom';
function Navbar() {
  return (
    <div className='navbar'>
{/*  
   <h2>METAVERSE</h2> */}
    <ul>
        <li>  <Link to="/">Home</Link></li>
        <li>About Us</li>
        <li>Pricing</li>
        <li> <Link to="/signup">Sign Up</Link></li>
        <li>LogIn</li>
        <li> <Link to="/signup">Sign Up</Link><i class="fa-solid fa-gear"></i></li>

    </ul>
 
    </div>
  )
}

export default Navbar
